代码配置

项目的主启动类添加@MapperScan("com.coderstring.rbac.dao")  ， 这里扫描的是对应的mapper接口的存放的包路径
数据库交互配置如下
spring:
  datasource:
    driver-class-name: com.mysql.cj.jdbc.Driver
    url: jdbc:mysql://127.0.0.1:3306/rbac?useUnicode=true&characterEncoding=utf-8&serverTimeZone=GMT
    username: root
    password: xxx

mybatis-plus:
  mapper-locations: classpath*:dao/*Mapper.xml
  configuration:
    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl

mapper接口配置

mapper接口类直接继承BaseMapper，就可以拥有基类的操作数据库的方法，具体实现方式例如下面的案例
public interface SysUserMapper extends BaseMapper {

}

实体类配置

@TableName("sys_user")
@Getter
@Setter
@ToString
@Accessors(chain = true)
public class SysUser implements Serializable{

    private static final long serialVersionUID = 1L;

    /**
     * 主键
     */
    @TableId(value = "id", type = IdType.AUTO)
    private Long id;

    /**
     * 用户名
     */
    @TableField("user_name")
    private String username;

    /**
     * 密码
     */
    @TableField("password")
    private String password;

    /**
     * 账号添加操作人
     */
    @TableField("operator")
    private Long operator;

    /**
     * 创建时间
     */
    @TableField(value = "created_at", fill = FieldFill.INSERT)
    @JsonFormat(pattern = "yyyy-MM-dd HH:mm:ss",timezone="GMT+8")
    private LocalDateTime createdAt;

    /**
     * 修改时间
     */
    @TableField(value = "updated_at", fill = FieldFill.INSERT_UPDATE)
    @JsonFormat(pattern = "yyyy-MM-dd HH:mm:ss",timezone="GMT+8")
    private LocalDateTime updatedAt;

    @TableField(value = "is_deleted")
    private Boolean isDeleted;
}
