获取数据的总数(也可以根据Wrapper过滤)
QueryWrapper wrapper = new QueryWrapper<>();
wrapper.gt("age", 28);
int count = simpleMapper.selectCount(wrapper);
map作为参数查询
Map map = new HashMap<>();
map.put("user_id", userId);
if(StringUtils.isNotEmpty(name)) {
    map.put("name", name);
}
if(null != age) {
    map.put("age", age);
}

List userBeanList = simpleMapper.selectByMap(map);
动态查询
QueryWrapper wrapper = new QueryWrapper<>();
wrapper.eq("user_id", userId);

// 第一个参数为是否执行条件，为true则执行该条件
// 下面实现根据 name 和 age 动态查询
wrapper.eq(StringUtils.isNotEmpty(name), "name", name);
wrapper.eq(null != age, "age", age);

List userBeanList = simpleMapper.selectList(wrapper);
分页查询
// 根据版本的不同配置的方式有所区别
@Configuration
public class MybatisPlusConfig {

    /**
     * 分页插件。如果你不配置，分页插件将不生效
     */
    @Bean
    public MybatisPlusInterceptor paginationInterceptor() {
        MybatisPlusInterceptor interceptor = new MybatisPlusInterceptor();
        // 指定数据库方言为 MYSQL
        interceptor.addInnerInterceptor(new PaginationInnerInterceptor(DbType.MYSQL));
        return interceptor;
    }
}


QueryWrapper wrapper = new QueryWrapper<>();
wrapper.isNotNull("user_id");

// 创建分页对象（1表示第一页；4表示每页大小为4）
